        static Regex RemovePostcodeFormattingRegEx = new Regex(@"\s");
        public static string RemovePostcodeFormatting(string postcode)
        {
            if (postcode == null) return "";
            var p = RemovePostcodeFormattingRegEx.Replace(postcode, "")
                ;
            return p.ToUpper();
        }


